function setCookie(e,t,o){let i=new Date;i.setTime(i.getTime()+24*o*60*60*1e3);let n="expires="+i.toUTCString();document.cookie=e+"="+t+";"+n+";path=/",console.log("cookie set")}function getCookie(e){let t=e+"=",o=document.cookie.split(";");for(let e=0;e<o.length;e++){let i=o[e];for(;" "==i.charAt(0);)i=i.substring(1);if(0==i.indexOf(t))return i.substring(t.length,i.length)}return""}function deleteCookie(e){getCookie(e)&&(document.cookie=e+"=;path=/;expires=Thu, 01 Jan 1970 00:00:01 GMT")}